import React from 'react'
import '../App.css'
import{useSta} from 'react'

function Apartment() {
  const [HouseType, setHouseType] = useSta('')
  const [Location, setLocation] = useSta('')
  const [EstimatedCost, setEstimatedCost] = useSta('')
  const [NumberOfRooms, setNumberOfRooms] = useSta(0)
  const [FloorNumber, setFloorNumber] = useSta(0)

  const displayInfo = () => {
    console.log(
      HouseType + Location + EstimatedCost + NumberOfRooms + FloorNumber,
    )
  }
  return (
    <div className="apar">
      <div className="apar-info">
        <label>House Type:</label>
        <input
          type="text"
          onChange={(event) => {
            setHouseType(event.target.value)
          }}
        />
        <label>Location:</label>
        <input
          type="text"
          onChange={(event) => {
            setLocation(event.target.value)
          }}
        />
        <label>Estimated Cost:</label>
        <input
          type="text"
          onChange={(event) => {
            setEstimatedCost(event.target.value)
          }}
        />
        <label>Number Of Rooms</label>
        <input
          type="number"
          onChange={(event) => {
            setNumberOfRooms(event.target.value)
          }}
        />
        <label>Floor Number:</label>
        <input
          type="number"
          onChange={(event) => {
            setFloorNumber(event.target.value)
          }}
        />
        <button onClick={displayInfo}>Add House</button>
      </div>
    </div>
  )
}
export default Apartment
